import React from 'react';
import './lownav.css';
function LowNav() {
    return (
      <div className="lowNav">
        <svg viewBox="0 0 33.263 6.821" height={25.781} width={125.72}>
                <defs>
                    <radialGradient
                    r={125}
                    fy={66.752}
                    fx={76.011}
                    cy={66.752}
                    cx={76.011}
                    gradientTransform="matrix(-.24798 -.00014 -.00015 .06613 183.768 159.336)"
                    gradientUnits="userSpaceOnUse"
                    id="prefix__c"
                    xlinkHref="#prefix__a"
                    />
                    <radialGradient
                    r={39.789}
                    fy={4.737}
                    fx={238.498}
                    cy={4.737}
                    cx={238.498}
                    gradientTransform="matrix(-.66704 -.34957 -.69295 .33751 327.782 247.159)"
                    gradientUnits="userSpaceOnUse"
                    id="prefix__d"
                    xlinkHref="#prefix__b"
                    />
                    <linearGradient id="prefix__a">
                    <stop offset={0} stopColor="#fff" />
                    <stop offset={1} stopOpacity={0.213} />
                    </linearGradient>
                    <linearGradient id="prefix__b">
                    <stop offset={0} stopColor="#f80300" />
                    <stop offset={1} stopColor="#cb0200" />
                    </linearGradient>
                </defs>
                <path
                    d="M165.525 168.208c-2.205 0-4.391-.016-5.996-.048h-10.607v-1.727a.192.192 0 00.004-.042v-1.674c.66-.578 6.903-3.01 8.27-3.188 1.442-.19 15.216-.19 16.66 0 1.442.188 8.33 2.891 8.33 3.269v3.362h-10.664c-1.605.032-3.791.048-5.997.048z"
                    fill="url(#prefix__c)"
                    transform="translate(-148.922 -161.387)"
                />
                <path
                    d="M165.525 168.204c-2.205 0-4.391-.015-5.996-.044h-10.607v-1.572a.16.16 0 00.004-.038v-1.523c.66-.527 6.903-2.74 8.27-2.902 1.442-.172 15.216-.172 16.66 0 1.442.171 8.33 2.631 8.33 2.975v3.06h-10.664c-1.605.029-3.791.044-5.997.044z"
                    fill="url(#prefix__d)"
                    transform="translate(-148.922 -161.387)"
                />
            </svg>
      </div>
    );
  }

export default LowNav;
